import React from "react";

function List({ contacts }) {
  return (
    <div>
      <input placeholder="Filter Contacts" />
      <ul>
        {contacts.map((contacts, index) => {
          return (
            <div
              style={{
                display: "flex",
                justifyContent: "space-between",
                alignItems: "center",
              }}
            >
              <li key={index}>
                {contacts.fullName} - {contacts.phone}
              </li>
            </div>
          );
        })}
      </ul>
    </div>
  );
}

export default List;
